measurements.description:
Forty-one flowers on three up to 71-cm arched inflorescences;
sepals and petals chartreuse. maroon veins, blushed maroon except margins, dorsal sepal hooded, lateral sepals 
swept forward;
lip fimbriate, cream spotted mahogany, keels ciliate, cream spotted mahogany;
column light yellow, inferior surface spotted mahogany;
 substance firm; texture matte.
